import SummaryOfAddedMovies from "../Components/SummaryOfAddedMovies";
import { useEffect } from "react";

function Account() {
  //create a GET REQUEST from db.json
  useEffect(() => {
    fetch("http://localhost:3000/movies");
  });

  return (
    <div>
      <div id='home-name'>
        <h1>Account</h1>
      </div>
      <SummaryOfAddedMovies />
    </div>
  );
}

export default Account;
